import '../App.css'


interface Props {
    data: any,
    selectedView: any
}


const SelectionDetails= ({data, selectedView}: Props) => {
    console.log(selectedView)

    return (
        <div style={{width: "100px", height:"100px", display:'flex', flexDirection:"column"}}>

            <div style={{display: "flex", flexDirection:"row", justifyContent:"space-between", width:"50vw"}}>
                <h1>{selectedView.client}</h1>
                <h1>{selectedView.houseBillNumber}</h1>
            </div>

            <div style={{display: "flex"}}>
                
            </div>
            {selectedView.destination}
            {selectedView.estimatedArrival}
            {selectedView.estimatedDeparture}
            {selectedView.id}
            {selectedView.mode}
            {selectedView.origin}
            {selectedView.status}
        </div>
    )
}

export default SelectionDetails;
